require.config({"config": {
        "text":{"Magento_Bundle/template/product/price/minimal_price.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<if args=\"getMinimalPriceAmount($row()) < getMaximumPriceAmount($row())\">\n    <span class=\"price-container\"\n          css=\"getAdjustmentCssClasses($row())\">\n        <span if=\"label\"\n              class=\"price-label\"\n              text=\"label\"></span>\n\n        <span class=\"price-wrapper\"\n              css=\"priceWrapperCssClasses\"\n              attr=\"priceWrapperAttr\"\n              data-price-amount=\"\"\n              data-price-type=\"\"\n              html=\"getMinimalPriceUnsanitizedHtml($row())\"></span>\n\n        <each args=\"data: getAdjustments(), as: '$adj'\">\n                <render args=\"$adj.getBody()\"></render>\n        </each>\n    </span>\n</if>\n"}
}});
